import {BrowserRouter, Routes, Route} from "react-router-dom";

import { Products } from "./pages/Products/Products";
import NoPage from "./pages/NoPage";
import Contact  from "./pages/Contact";
 import About   from "./pages/About/About";
import NavBar from "./components/NavBar";
import Footer from "./components/Footer";
import  Home from "./pages/Home";


// import { ProductsBottomsAsc } from "./pages/ProductsBottomsAsc";
// import { ProductsBottomsDesc } from "./pages/ProductsBottomsDesc";
// import { ProductsDressesAsc } from "./pages/ProductsDressesAsc";
// import { ProductsDressesDesc } from "./pages/ProductsDressesDesc";
// import { ProductsTopAsc } from './pages/Tops/ProductsTopAsc';
// import { ProductsAsc } from "./pages/Products/ProductsAsc";
// import { ProductsDesc } from "./pages/Products/ProductsDesc";
// import { ProductsTopDesc } from "./pages/Tops/ProductsTopsDesc";


function App() {
  return (
    <BrowserRouter>
    <div className="App" id="background-img">
      <nav><NavBar/></nav>
    <Routes>
    <Route path="/" element={<Home />}/>
      <Route path="home" element={<Home />}/>
      <Route path="shop" element={<Products/>}/>
        {/* <Route path="shopProductsAsc" element={<ProductsAsc/>}/>
        <Route path="shopProductsDesc" element={<ProductsDesc/>}/>
        <Route path="shopProductsTopAsc" element={<ProductsTopAsc/>}/>
        <Route path="shopProductsTopDesc" element={<ProductsTopDesc/>}/>
        <Route path="shopProductsBottomsAsc" element={<ProductsBottomsAsc/>}/>
        <Route path="shopProductsDressesAsc" element={<ProductsDressesAsc/>}/>
        <Route path="shopProductsBottomsAsc" element={<ProductsBottomsDesc/>}/>
        <Route path="shopProductsDressesAsc" element={<ProductsDressesDesc/>}/> */}
      <Route path="*" element={<NoPage />} />
      <Route path="contact" element={<Contact/>}/>
      <Route path="about" element={<About/>}/>
    </Routes>
    <footer> <Footer/> </footer>
    </div>
  </BrowserRouter>
  );
}

export default App;
